//change whith promises
var _scarga={
	items:new Array(),
	complete_items:0,
	abort:false,
	exec:null,
	
	message:{
		
		bool:false,id_container:null,id_mess:null,
		text_init:"Cargando...",text:"",
		
		create:function(){
			
			this.id_mess = document.createElement("p");
			this.id_mess.setAttribute('id','carga');
			this.id_mess.style='font-size: 30px;z-index:3;position:fixed;\
			color: #52ddae;left:25px;bottom:0px;'
			this.id_container.appendChild( this.id_mess );
		},
		print:function(e){//text
			
			var t = document.createTextNode(e); 
			this.id_mess.appendChild(t);
			this.text="";
		},
		
		clear:function(e){//text
			
			this.id_mess.remove();
		},
		
	},
	items_put:function(e){//e img
		
		this.items.push(e);
		
		e.onload=function(){
		//
			_scarga.complete_items++;
			
			if(_scarga.message.bool && !_scarga.abort){
				
				_scarga.message.print("..."+this.src);
			}
			
			if(_scarga.complete_items == _scarga.items.length){
				
				if(_scarga.message.bool){_scarga.message.clear();}	
				
				if(!_scarga.abort){
					
					_scarga.exec();
				}else{
					
					_scarga.abort=false;
				}
			}
		};
		
	},
	init:function(){
		
		this.abort=false;
		
		if( this.message.bool ){ 
			
			this.message.create();
			this.message.print(this.message.text_init);
		}
	}
};
